          <input type="date"></input>
          <input type="date"></input>
          <lable>post code area</lable>
          <input type="text"></input>
          <button> search </button>
        </div>
      )}
      <div className='App-innerdiv'>
        <Avilable />
        <Favourites />
      </div>
      <Footer />
    </div>
  );
}

export default App;
